import React from 'react';
import './styles.css';
import { Link } from 'react-router-dom';
import data from './data';
import GetMockData from './GetMockData'

export class AllShoppingLists extends React.Component {
    showList({name}) {
        <h2>{ name }</h2>
        alert(`hello, ${name}`);
    }

    render() {
        return(
            <section className="listoflists">
                <h1>Shopping Lists</h1>

                    {data.map(listName => (
                            <p><button onClick={() => showList(listName.name)} >
                                <GetMockData
                                    key={listName.name}
                                    name={listName.name}
                                />
                            </button></p>
                    ))}
                </section>
        );
    }

}
export default AllShoppingLists;
